import React from "react";
import TeamMember from "./TeamMember";

function TeamProfile() {
  return (
    <div className="row">
      <TeamMember
        member={{
          id: 1,
          img: "../images/01.jpg",
          name: "Walter White",
          position: "Bryan Cranston",
          phone: "+49 12345678",
          email: "walter@b-bad.com",
          website: "walterwhite.com",
        }}
      />
    </div>
  );
}

export default TeamProfile;
